import React from "react";

function Podcast() {
  return (
    <>
      <div class="center">
        <img
          src="./baconsale.webp"
          alt="baconsale"
          width="200"
          class="center"
        />
        <br /> <br />
        <a href="https://www.youtube.com/watch?v=dQw4w9WgXcQ">
          Here is Joel's Baconsale Site!
        </a>
      </div>
    </>
  );
}

export default Podcast;
